import React from "react";
import { NavbarContainer, NavLinksContainer } from "./NavbarStyles";

const Navbar = (props:{}) => {

    const navlinks = ["home", "new", "popular", "trending", "categories"];

    const navlinksWrapped = navlinks.map((link, index) => (
        <li>
            <a href={`${link}`}></a>
        </li>
    ))
    return (
        <NavbarContainer>
        <h2 >Navbar</h2>
        </NavbarContainer>
    );
};

export default Navbar;
